import styled from 'styled-components';

const Box = styled.div`
    max-width: 200px;
    select {
        padding: 5px;
        background-color: #f0ca45;
        font-size: 20px;
        font-weight: bold;
        border-radius: 25px;
    }

`;

export default Box;
